define('components/filter/base', function(require, exports, module) {

var Vue = require("component_modules/vue");

/**
 * 时间格式化
 */
Vue.filter('datetime', function (value) {
    return (new Date(value)).Format("yyyy-MM-dd hh:mm")
});

/**
 * 隐藏保单号
 */
Vue.filter('hidePolicy', function (value) {
    value = value+"" ||"";
    return value.substr(0, 4) + "***" + value.substr(-4, 4);
});

/**
 * 金额格式化
 *  value 金额，以分为单位
 */
Vue.filter('moneyFormat', function (value, num) {
    value = value/100;//转换为元
    num = num || 2;
    if (parseFloat(value) > 0) {
        var str = parseFloat(value).toFixed(num);
        str = str.split(".");
        var start = parseFloat(str[0]).toLocaleString();
        return start + "." + (str[1] || "")
    } else {
        return 0
    }
});
/**
 * 转化为百分数显示
 */
Vue.filter('percentFormat', function (value, num) {
    value = value*100;//转换为元
    return new Number(value.toFixed(4)).toString()+"%";
});

/**
 * 地点id转地点名称 过滤器
 */
Vue.filter('findCity', function (value, deep) {
    var xml;
    deep = deep || 3;
    if ($.fn.citySelect.cityxml) {
        xml = $.fn.citySelect.cityxml;
    } else {
        $.ajax({
            url: "static/data/area.xml", //XML文件相对路径
            async: false,
            dataType: "xml", //指明文件类型为“xml”
            success: function (data) {
                xml = data;
                $.fn.citySelect.cityxml = xml
            }
        });
    }
    function getName(node) {
        var str = "";
        if (node.length == 1 && deep > 0) {
            deep--;

            var parent = node.parent();
            console.log(node.attr("name"));
            str = node.attr("name");
            if (str == "") {
                return ""
            }
            if (parent.length != 0) {
                str = (getName(parent) || "") + "-" + str;
            }
        }
        return str
    }

    var aim = $(xml).find('[code=' + value + ']');

    return getName(aim).substring(1);
})

});

