define("components/page/bdtk/index",function(p,n,s){var a=p("component_modules/vue"),e=p("components/common/BasePage");s.exports=a.extend({mixins:[e],className:"bdtk",template:'<div class="bdtk" id="bdtk">\r\n\r\n    <div id="u14" class="text">\r\n        <p><span>中国大地财产保险股份有限公司</span></p><p><span>公路货物运输保险（2014版）条款</span></p><p><span>&nbsp;</span></p><p><span>保险标的范围</span></p><p><span>第一条 在中华人民共和国境内（不包括港澳台地区）通过公路运输的货物可作为保险标的。</span></p><p><span>第二条 下列货物非经投保人与保险人特别约定，并在保险单或其他保险凭证上载明，不在保险标的范围以内：金银、珠宝、钻石、玉器、首饰、古币、古玩、古书、古画、邮票、艺术品、稀有金属等珍贵财物。</span></p><p><span>第三条 下列货物不在保险标的范围以内：蔬菜、水果，活牲畜、禽鱼类和其他动物，以及任何非法货物。</span></p><p><span>&nbsp;</span></p><p><span>保险责任</span></p><p><span>第四条 投保人可根据需要，选择投保基本险或综合险。</span></p><p><span>第五条 基本险</span></p><p><span>（一）保险人对由于下列原因造成的被保险货物的损失，按照本保险合同的约定负责赔偿：</span></p><p><span>1、火灾、爆炸、雷电、冰雹、暴风、暴雨、洪水、海啸、地陷、崖崩、突发性滑坡、泥石流；</span></p><p><span>2、运输工具发生碰撞、倾覆，或隧道、码头坍塌，或在驳运过程中因驳运工具遭受搁浅、触礁、沉没、碰撞；</span></p><p><span>3、在装货、卸货或转载时发生意外事故；</span></p><p><span>4、在上述各项自然灾害或意外事故发生时，因纷乱致使被保险货物散失。</span></p><p><span>（二）保险事故发生后，被保险人为防止或减少保险标的的损失所支付的必要的、合理的费用（以下简称“施救费用”），保险人按照本保险合同的约定也负责赔偿。</span></p><p><span>第六条 综合险</span></p><p><span>（一）保险人除承担基本险的保险责任外，还对由于下列原因造成的被保险货物的损失，按照本保险合同的约定负责赔偿：</span></p><p><span>1、因碰撞、挤压而造成货物破碎、弯曲、凹瘪、折断、开裂；</span></p><p><span>2、因包装破裂致使货物散失；</span></p><p><span>3、液体货物因受碰撞或挤压致使所用容器（包括封口)损坏而渗漏，或用液体保藏的货物因液体渗漏而造成该货物腐烂变质；</span></p><p><span>4、在符合安全运输规定情况下遭受雨淋。</span></p><p><span>（二）前款各项约定的保险事故发生后发生的施救费用，保险人按照本保险合同的约定也负责赔偿。</span></p><p><span>&nbsp;</span></p><p><span>责任免除</span></p><p><span>第七条 由于下列原因造成的损失、费用，保险人不负责赔偿：</span></p><p><span>（一）战争、敌对行为、军事行动、扣押、罢工、暴动、哄抢；</span></p><p><span>（二）地震；</span></p><p><span>（三）盗窃或整件提货不着；</span></p><p><span>（四）在保险责任开始前，被保险货物已存在的品质不良或数量短差；</span></p><p><span>（五）被保险货物的自然损耗、本质缺陷、特性；</span></p><p><span>（六）市价跌落、运输延迟；</span></p><p><span>（七）发货人责任；</span></p><p><span>（八）投保人、被保险人的故意行为或违法行为。</span></p><p><span>第八条 其他不属于本保险责任范围的损失、费用，保险人不负责赔偿。</span></p><p><span>&nbsp;</span></p><p><span>责任起讫</span></p><p><span>第九条 保险责任自签发保险单或其他保险凭证后，被保险货物运离起运地发货人的最后一个仓库或储存处所时开始，至该保险单或其他保险凭证上注明的目的地的收货人在当地的第一个仓库或储存处所时终止。但被保险货物运抵目的地后，如果收货人未及时提货，则自被保险货物卸离运输工具次日起算，保险责任的终止期最多延长十五天。</span></p><p><span>&nbsp;</span></p><p><span>保险金额</span></p><p><span>第十条 保险金额由投保人以投保时货物的实际价值或货物的实际价值加运杂费为基础自行确定，并在保险合同中载明。</span></p><p><span>&nbsp;</span></p><p><span>投保人、被保险人的义务</span></p><p><span>第十一条 投保人应当履行如实告知义务，如实回答保险人就保险标的或者被保险人的有关情况提出的询问。</span></p><p><span>投保人故意或因重大过失未履行前款约定的如实告知义务，足以影响保险人决定是否同意承保或者提高保险费率的，保险人有权解除保险合同。</span></p><p><span>投保人故意不履行如实告知义务的，保险人对于保险合同解除前发生的保险事故，不承担赔偿保险金的责任，并不退还保险费。</span></p><p><span>投保人因重大过失未履行如实告知义务，对保险事故的发生有严重影响的，保险人对于保险合同解除前发生的保险事故，不承担赔偿保险金的责任，但应当退还保险费。</span></p><p><span>第十二条 投保人在保险人或其代理人签发保险单或其他保险凭证的同时，应一次交清保险费。发生保险事故时，投保人未交付保险费的，保险人不承担赔偿保险金的责任；投保人已交付部分保险费的，保险人按照已交付保险费与保险费总额的比例承担赔偿保险金的责任。</span></p><p><span>第十三条　投保人和被保险人应当严格遵守国家及交通运输主管部门关于安全运输的各项规定，维护保险标的的安全。货物运输包装应当符合国家和主管部门规定的标准。</span></p><p><span>保险人可以对保险标的的安全状况进行检查，向投保人、被保险人提出消除不安全因素和隐患的书面建议，被保险人应该认真付诸实施。</span></p><p><span>因被保险人未遵守上述约定而导致保险事故的，保险人不承担赔偿保险金的责任；因被保险人未遵守上述约定而导致损失扩大的，保险人对扩大的损失不承担赔偿保险金的责任。</span></p><p><span>第十四条　在合同有效期内，保险标的危险程度显著增加的，被保险人应当及时通知保险人，保险人有权要求增加保险费或者解除合同。 </span></p><p><span>被保险人未履行前款约定的通知义务的，因保险标的危险程度显著增加而发生的保险事故，保险人不承担赔偿保险金的责任。</span></p><p><span>第十五条 被保险货物如果发生保险责任范围内的损失，投保人或被保险人获悉后，应迅速采取合理的施救和保护措施，并立即通知保险人的当地机构（自当日起算，最迟不超过10天）。</span></p><p><span>故意或者因重大过失未及时通知，致使保险事故的性质、原因、损失程度等难以确定的，保险人对无法确定的部分，不承担赔偿保险金的责任，但保险人通过其他途径已经及时知道或者应当及时知道保险事故发生的除外。</span></p><p><span>&nbsp;</span></p><p><span>赔偿处理</span></p><p><span>第十六条 被保险人向保险人申请索赔时，应当提供下列有关单证：</span></p><p><span>（一）保险单或其他保险凭证、运单（货票）、提货单、发票（货价证明）；</span></p><p><span>（二）承运部门出具的事故签证、交接验收记录、鉴定书；</span></p><p><span>（三）收货人的入库记录、检验报告、损失清单及施救费用单据；</span></p><p><span>（四）被保险人所能提供的与确认保险事故的性质、原因、损失程度等有关的其他证明和资料。</span></p><p><span>第十七条 保险人收到被保险人的赔偿请求后，应当及时就是否属于保险责任作出核定。情形复杂的，保险人在收到被保险人的赔偿请求并提供理赔所需资料后三十日内未能核定保险责任的，保险人与被保险人根据实际情形商议合理期间，保险人在所商定的期间内作出核定。</span></p><p><span>保险人应当将核定结果通知被保险人。对属于保险责任的，在与被保险人达成有关赔偿金额的协议后十日内，履行赔偿义务；对不属于保险责任的，应当自作出核定之日起三日内向被保险人发出拒绝赔偿保险金的通知，并说明理由。</span></p><p><span>第十八条 被保险货物遭受损失后，如果有残余价值，应由双方协商处理。如折归被保险人，由双方协商确定其价值，并在保险赔款中扣除。</span></p><p><span>第十九条 被保险货物发生保险责任范围内的损失，保险人按以下方式计算赔偿：</span></p><p><span>（一）保险金额等于或高于保险价值时，按实际损失计算赔偿，最高不超过保险价值；</span></p><p><span>（二）保险金额低于保险价值时，按保险金额与保险价值的比例乘以实际损失计算赔偿，最高不超过保险金额。</span></p><p><span>第二十条 对于施救费用，保险人按以下方式计算赔偿：</span></p><p><span>保险金额大于或等于保险价值时，施救费用在被保险货物的损失赔偿金额以外另行计算，最高不超过保险价值。</span></p><p><span>保险金额小于保险价值时，上述费用按保险金额与保险价值的比例在被保险货物的损失赔偿金额以外另行计算，最高不超过保险金额。</span></p><p><span>第二十一条 发生保险责任范围内的损失，应由有关责任方负责赔偿的，保险人自向被保险人赔偿保险金之日起，在赔偿金额范围内代位行使被保险人对有关责任方请求赔偿的权利，被保险人应当向保险人提供必要的文件和所知道的有关情况。</span></p><p><span>被保险人已经从有关责任方取得赔偿的，保险人赔偿保险金时，可以相应扣减被保险人已从有关责任方取得的赔偿金额。</span></p><p><span>保险事故发生后，在保险人未赔偿保险金之前，被保险人放弃对有关责任方请求赔偿权利的，保险人不承担赔偿责任；保险人向被保险人赔偿保险金后，被保险人未经保险人同意放弃对有关责任方请求赔偿权利的，该行为无效；由于被保险人故意或者因重大过失致使保险人不能行使代位请求赔偿的权利的，保险人可以扣减或者要求返还相应的保险金。</span></p><p><span>&nbsp;</span></p><p><span>争议处理和法律适用</span></p><p><span>第二十二条 因履行本保险合同发生的争议，由当事人协商解决。协商不成的，提交保险单载明的仲裁机构仲裁；保险单未载明仲裁机构且争议发生后未达成仲裁协议的，依法向人民法院起诉。</span></p><p><span>第二十三条 与本保险合同有关的以及履行本保险合同产生的一切争议，适用中华人民共和国法律（不包括港澳台地区法律）。</span></p><p><span>&nbsp;</span></p><p><span>其他事项</span></p><p><span>第二十四条 凡经公路与其他运输方式联合运输的被保险货物，按相应的运输方式分别适用本条款及《铁路货物运输保险条款》、《水路货物运输保险条款》和《国内航空货物运输保险条款》。</span></p><p><span>第二十五条 凡涉及本保险的约定均应采用书面形式。</span></p><p><span>&nbsp;</span></p>\r\n    </div>\r\n</div>\r\n',pageName:"保险条款"})});
