define("components/page/bdxhtk/index",function(p,n,s){var a=p("component_modules/vue"),e=p("components/common/BasePage");s.exports=a.extend({mixins:[e],className:"bdxhtk",template:'<div class="bdtk" id="bdxhtk">\r\n\r\n    <div id="u14" class="text">\r\n        <p><span>中国大地财产保险股份有限公司</span></p><p><span>国内鲜活货物运输保险条款</span></p><p><span>&nbsp;</span></p><p><span>总则</span></p><p><span>第一条 本保险合同（以下简称“本合同”）由保险条款、投保单、保险单以及批单组成。凡涉及本合同的约定，均应采用书面形式。</span></p><p><span>第二条 凡依法设立的企事业单位、社会团体、个体工商户、其他经济组织和自然人，均可作为投保人、被保险人。</span></p><p><span>保险标的</span></p><p><span>第三条 在中华人民共和国境内（不包含港澳台地区）运输且符合专业运输要求的下列货物，均可作为本保险的保险标的：</span></p><p><span>第一类货物：活家禽、活牲畜、活水产；</span></p><p><span>第二类货物：新鲜蔬菜、新鲜水果、花草、苗木、粮食、以及新鲜水产、新鲜肉蛋奶；</span></p><p><span>第三类货物：上述所列明第一类和第二类货物的加工品。</span></p><p><span>第四条 下述货物未经保险合同双方特别约定并在保险合同中载明保险价值的，不属于本保险的保险标的：</span></p><p><span>依照中华人民共和国有关法律法规的规定属于受保护野生动植物、珍稀濒危保护动植物范围内，且被保险人依法可以将其运输并符合专业运输要求的动植物。</span></p><p><span>保险责任</span></p><p><span>第五条　在保险期间内，由于下列原因造成属于第一类货物的保险标的死亡的直接损失，保险人依照本合同的约定负责赔偿：</span></p><p><span>（一）雷电、冰雹、暴风、暴雨、洪水；</span></p><p><span>（二）地陷、崖崩、突发性滑坡、泥石流；</span></p><p><span>（三）火灾、爆炸；</span></p><p><span>（四）运输工具发生碰撞、倾覆、坠落、搁浅、触礁、沉没，或遭遇隧道、码头坍塌。</span></p><p><span>第六条 在保险期间内，由于第五条所列明原因造成属于第二类或第三类货物的保险标的的直接损失，保险人依照本合同的约定负责赔偿。</span></p><p><span>第七条 保险事故发生后，被保险人为防止或者减少保险标的的损失所支付的必要的、合理的费用，保险人按照本合同的约定也负责赔偿。</span></p><p><span>责任免除</span></p><p><span>第八条 由于下列原因造成保险标的的损失和费用，保险人不负责赔偿：</span></p><p><span>（一）地震、海啸；</span></p><p><span>（二）核辐射、核爆炸、核污染、放射性污染、大气污染、土地污染及其他各种污染；</span></p><p><span>（三）行政行为或司法行为；</span></p><p><span>（四）战争、敌对行为、军事行为、武装冲突、罢工、骚乱、暴动、恐怖活动；</span></p><p><span>（五）属于发货人责任引起的损失；在保险责任开始前，保险标的已存在品质不良或数量短少所形成的损失；包装不善；</span></p><p><span>（六）保险标的的自然损耗、本质缺陷，市价跌落；</span></p><p><span>（七）盗窃、抢劫、哄抢行为； </span></p><p><span>（八）投保人、被保险人的故意、重大过失或违法行为；</span></p><p><span>（九）疾病、怀仔、防疫注射或接种。</span></p><p><span>第九条 下列损失和费用，保险人不负责赔偿：</span></p><p><span>（一）无论任何原因引起的运输延迟所导致的货物损失；</span></p><p><span>（二）罚款、罚金、惩罚性赔偿、精神损害赔偿及其他各种间接损失；</span></p><p><span>（三）本合同中载明的每次事故免赔额或按照本合同中载明的每次事故免赔率计算的每次事故免赔额。</span></p><p><span>第十条 若采用定额保险方式承保，下列情形下发生的损失和费用，保险人也不负责赔偿：</span></p><p><span>（一）不符合专业及安全运输要求；</span></p><p><span>（二）驾驶人员酒后驾车、无有效驾驶证驾驶，承运汽车无有效行驶证、未经检验或检验不合格。</span></p><p><span>第十一条 其他不属于保险责任范围内的损失和费用，保险人不负责赔偿。</span></p><p><span>责任起讫</span></p><p><span>第十二条 保险责任自签发保险单后，保险标的装上保险单所载明的运输工具时开始，至卸离运输工具时终止。</span></p><p><span>若保险标的运抵目的地后未立即卸离运输工具，公路运输的，保险责任最多延长至到达目的地后三小时终止；其他运输方式的，保险责任最多延长至到达目的地后二十四小时终止。</span></p><p><span>保险价值、保险金额与免赔额（率）</span></p><p><span>第十三条 保险价值按运输工具所载保险标的发票金额或发票金额加运杂费确定。保险金额参照保险价值确定，也可以由保险双方协商确定，并在保险合同中载明。</span></p><p><span>第十四条 每次事故免赔额（率）由投保人与保险人在订立保险合同时协商确定，并在保险合同中载明。</span></p><p><span>投保人、被保险人的义务</span></p><p><span>第十五条 投保人、被保险人应当履行如实告知义务，如实回答保险人就保险标的或投保人、被保险人的有关情况提出的询问，并如实填写投保单。</span></p><p><span>投保人故意或者因重大过失未履行前款规定的如实告知义务，足以影响保险人决定是否同意承保或者提高保险费率的，保险人有权解除本合同。本合同自保险人的解约通知书到达投保人或被保险人时解除。</span></p><p><span>投保人故意不履行如实告知义务的，保险人对于本合同解除前发生的保险事故，不承担赔偿责任，并不退还保险费。</span></p><p><span>投保人因重大过失未履行如实告知义务，对保险事故的发生有严重影响的，保险人对于本合同解除前发生的保险事故，不承担赔偿责任，但应当退还保险费。</span></p><p><span>第十六条 投保人在保险人或其代理人签发保险单（凭证）时，应一次交清保险费。</span></p><p><span>第十七条 发生保险责任范围内的事故，被保险人应当：</span></p><p><span>（一）立即通知保险人，并书面说明事故发生的原因、经过和损失程度。故意或者因重大过失未及时通知，致使保险事故的性质、原因、损失程度等难以确定的，保险人对无法确定的部分，不承担赔偿责任，但保险人通过其他途径已经及时知道或者应当及时知道保险事故发生的除外；</span></p><p><span>（二）尽力采取必要、合理的措施，使损失减少至最低限度。否则，对因此扩大的损失，保险人不承担赔偿责任；</span></p><p><span>（三）保护事故现场，允许并且协助保险人进行事故查勘。对于拒绝或者妨碍保险人进行事故查勘导致无法确定事故原因或核实损失情况的，保险人对不能核实部分不承担赔偿责任。</span></p><p><span>第十八条 被保险人向保险人请求赔偿时，应提供下列单证：</span></p><p><span>（一）保险单正本、运输合同、货物发票；</span></p><p><span>（二）属于道路交通事故的，被保险人应当提供载运车辆的行驶证和驾驶证复印件、公安交通管理部门或法院等机构出具的事故证明、有关的法律文书（判决书、调解书、裁定书、裁决书等）；属于非道路交通事故的，应提供相关的事故证明；</span></p><p><span>（三）保险标的损失清单及救护保险标的而支付必要的、合理的费用的单据；</span></p><p><span>（四）投保人、被保险人所能提供的与确认保险事故的性质、原因、损失程度等有关的其他证明和资料。</span></p><p><span>投保人、被保险人未履行前款约定的单证提供义务，导致保险人无法核实损失情况的，保险人对无法核实的部分不承担赔偿责任。</span></p><p><span>第十九条 发生保险责任范围内的损失，应由有关责任方负责赔偿的，保险人自向被保险人赔偿保险金之日起，在赔偿金额范围内代位行使被保险人对有关责任方请求赔偿的权利，被保险人应当向保险人提供必要的文件和所知道的有关情况。</span></p><p><span>被保险人已经从有关责任方取得赔偿的，保险人赔偿保险金时，可以相应扣减被保险人已从有关责任方取得的赔偿金额。</span></p><p><span>保险事故发生后，在保险人未赔偿保险金之前，被保险人放弃对有关责任方请求赔偿权利的，保险人不承担赔偿责任。保险人向被保险人赔偿保险金后，被保险人未经保险人同意放弃对有关责任方请求赔偿权利的，该行为无效。由于被保险人故意或者重大过失致使保险人不能行使代位请求赔偿的权利的，保险人可以扣减或者要求返还相应的保险金。</span></p><p><span>赔偿处理</span></p><p><span>第二十条 保险人收到被保险人的赔偿请求后，应当及时就是否属于保险责任作出核定，并将核定结果通知被保险人。情形复杂的，保险人在收到被保险人的赔偿请求及理赔所需资料后三十日内未能核定保险责任的，保险人与被保险人根据实际情形商议合理期间，保险人在商定的期间内作出核定结果并通知被保险人。对于属于保险责任的，在与被保险人达成有关赔偿金额的协议后十日内，履行赔偿义务。</span></p><p><span>第二十一条 被保险人在请求赔偿时应当向保险人说明与受损标的有关的其他保险合同的情况。对未如实说明导致保险人多支付保险赔款的，保险人有权向被保险人追回多支付的部分。</span></p><p><span>第二十二条 保险标的发生保险责任范围内的损失时，保险人按照以下方式确定赔偿金额：</span></p><p><span>（一）保险金额等于或高于保险价值时，按实际损失金额扣除每次事故免赔额计算赔偿（见下一公式），最高不超过保险价值。</span></p><p><span>赔偿金额=实际货损金额-每次事故免赔额</span></p><p><span>（二）保险金额低于保险价值时，按实际损失金额乘以保险金额与保险价值的比例后扣除每次事故免赔额计算赔偿（见下一公式），最高不超过保险金额。</span></p><p><span>赔偿金额=实际货损金额×（保险金额/保险价值）-每次事故免赔额</span></p><p><span>第二十三条　保险标的的保险金额等于或高于保险价值时，被保险人为防止或减少保险标的的损失所支付的必要的、合理的费用，在保险标的损失赔偿金额之外另行计算赔偿，最高不超过被施救标的的保险价值。</span></p><p><span>保险标的的保险金额低于保险价值时，前款所述费用按被施救标的的保险金额与保险价值的比例，在保险标的损失赔偿金额之外另行计算赔偿，最高不超过被施救标的的保险金额。</span></p><p><span>第二十四条 被保险人向保险人请求赔偿的诉讼时效期间为二年，自其知道或者应当知道保险事故发生之日起计算。</span></p><p><span>争议处理</span></p><p><span>第二十五条　因履行本合同发生的争议，由当事人协商解决，协商不成的,提交保险单载明的仲裁机构仲裁；保险单未载明仲裁机构且争议发生后未达成仲裁协议的，依法向人民法院起诉。</span></p><p><span>第二十六条 与本合同有关的以及履行本合同产生的争议，适用中华人民共和国法律（不包括港澳台地区法律）。</span></p><p><span>释义</span></p><p><span>第二十七条 本合同有关术语释义如下：</span></p><p><span>（一）火灾：指在时间或空间上失去控制的燃烧所造成的灾害。它必须具备三个条件：1.有燃烧现象，即有热有光有火焰；2.偶然、意外发生的燃烧；3.燃烧失去控制并有蔓延扩大的趋势。</span></p><p><span>（二）爆炸：包括物理性爆炸和化学性爆炸。物理性爆炸指由于液体、固体变为蒸汽或气体膨胀，压力急剧增加并超过容器所能承受的极限压力而发生的爆炸。化学性爆炸指物体在瞬间分解或燃烧时放出大量的热和气体，并以很大的压力向四周扩散的现象。</span></p><p><span>（三）雷电：指积雨云中、云间或云地之间产生的放电现象，其破坏形式分为直接雷击和感应雷击两种。</span></p><p><span>（四）冰雹：从强烈对流的积雨云中降落到地面的冰块或冰球，是直径大于5毫米，核心坚硬的固体降水。</span></p><p><span>（五）暴风：指风力达8级、风速在17.2米/秒以上的自然风。</span></p><p><span>（六）暴雨：指每小时降雨量达16毫米以上，或连续12小时降雨量达30毫米以上，或连续24小时降雨量达50毫米以上的降雨。</span></p><p><span>（七）洪水：指山洪暴发、江河泛滥、潮水上岸及倒灌。</span></p><p><span>（八）地陷：地壳自然变异、地层收缩引起地面突然下陷。</span></p><p><span>（九）崖崩：石崖、土崖等陡坡上大块的岩石在重力作用下突然崩落的物理现象。</span></p><p><span>（十）突发性滑坡：斜坡上不稳的岩土体或人为堆积物在重力作用下突然整体向下滑动的现象。</span></p><p><span>（十一）泥石流：由于雨水、冰雪融化等水源激发的、含有大量泥沙石块的特殊洪流。</span></p><p><span>（十二）倾覆：指运输工具翻倒或倾侧失去正常状态，非经施救不能继续行驶。</span></p><p><span>&nbsp;</span></p><p><span>&nbsp;</span></p><p><span>&nbsp;</span></p><p><span>&nbsp;</span></p><p><span>&nbsp;</span></p>\r\n    </div>\r\n</div>\r\n',pageName:"鲜活类保险条款"})});
